import React, { Component } from 'react';
import axios from 'axios';
import BuildingList from '../components/buildingList'
import '../styles/css/home.css'

class Index extends Component {

    state = {
        buildingData : []
    }

    componentDidMount = async () => {
        const building = {
			method: 'get',
			url: 'http://0.0.0.0:5000/building',
			headers: {
				'Content-Type': 'application/json',
			}
        };

        const buildingRes = await axios(building)
        this.setState({buildingData : buildingRes.data})
        console.warn(this.state.buildingData)
    }

    render () {
        return (
            <React.Fragment>
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-md-6 col-12">
                            <div className="row px-1">
                                {this.state.buildingData.map(item=>
                                <BuildingList/>
                                )}
                            </div>
                        </div>
                        <div className="col-md-6 col-12">
                            <div className="border" style={{height:'500px'}}></div>
                        </div>
                    </div>
                </div>
            </React.Fragment>    
        );
    }
}

export default Index;
